import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <div className="navbar">
      <div className="logo">ankur</div>
      <div className="nav-items">
        <ul>
          <li>Work</li>
          <li>About</li>
          <li>Contacts</li>
        </ul>
      </div>
    </div>
  );
}

export default Nav;
